import React from 'react';
import './App.css'; // Make sure this path matches your file structure

const services = [
    {
        title: "Healthcare Services",
        image: "https://via.placeholder.com/150?text=Healthcare", // Replace with actual image
    },
    {
        title: "Pension & Finance",
        image: "https://via.placeholder.com/150?text=Pension",
    },
    {
        title: "Housing & Social Welfare",
        image: "https://via.placeholder.com/150?text=Housing",
    },
    {
        title: "ID & Documentation",
        image: "https://via.placeholder.com/150?text=ID+Docs",
    },
    {
        title: "Travel & Transport",
        image: "https://via.placeholder.com/150?text=Travel",
    },
    {
        title: "Legal & Emergency",
        image: "https://via.placeholder.com/150?text=Legal",
    },
];

const App = () => {
    return (
        <div className="container">
            <h1 style={{ textAlign: 'center' }}>Government Services</h1>
            <p style={{ textAlign: 'center' }}>Total Services: {services.length}</p>
            <div className="grid">
                {services.map((service, index) => (
                    <div className="grid-item" key={index}>
                        <img src={service.image} alt={service.title} />
                        <h2>{service.title}</h2>
                        <button>Read More</button>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default App;
